import React from "react"
import isNodeEnvironment from "source/plugins/@utils/isNodeEnv"

interface img64Props {
  url64: string | undefined
  alt: string
  className?: string
  width?: number
  height?: number
  defaultType?: string
}

function getDefaultImg(defaultType: string | undefined): string {
  switch (defaultType) {
    case "mal":
      return ""
    case "lastfm":
      return "null"
    default:
      return "null"
  }
}

function Img64({ url64, alt, className, width = 70, height = 110, defaultType }: img64Props): JSX.Element {
  const isNodeEnv = isNodeEnvironment()

  if (!url64) {
    const defaultUrl64 = getDefaultImg(defaultType)
    return (
      <img
        src={`${isNodeEnv ? "data:image/jpeg;base64," : ""}${defaultUrl64}`}
        alt={alt}
        data-name={alt}
        {...(className && { className })}
        width={width}
        height={height}
      />
    )
  }

  return (
    <img
      src={`${isNodeEnv ? "data:image/jpeg;base64," : ""}${url64}`}
      alt={alt}
      data-name={alt}
      {...(className && { className })}
      width={width}
      height={height}
    />
  )
}

export default Img64
